import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function App() {
  const [nodes, setNodes] = useState([]);
  const [jobs, setJobs] = useState([]);
  const [energyMetrics, setEnergyMetrics] = useState([]);
  const [schedulingAlgorithms, setSchedulingAlgorithms] = useState([]);
  const [selectedAlgorithm, setSelectedAlgorithm] = useState(null);
  const [algorithmMetrics, setAlgorithmMetrics] = useState({});

  useEffect(() => {
    // Fetch data from backend API or mock data
    // For now, using mock data
    const mockNodes = [
      { id: 'node1', temperature: 65, power: 150, fanSpeed: 70 },
      { id: 'node2', temperature: 70, power: 160, fanSpeed: 75 },
      { id: 'node3', temperature: 60, power: 140, fanSpeed: 65 },
    ];
    const mockJobs = [
      { id: 'job1', status: 'running', node: 'node1', power: 50, duration: 120, remaining: 60 },
      { id: 'job2', status: 'queued', node: null, power: 0, duration: 90, remaining: 90 },
      { id: 'job3', status: 'completed', node: 'node2', power: 0, duration: 180, remaining: 0 },
    ];
    const mockEnergyMetrics = [
      { time: '10:00', power: 450 },
      { time: '10:05', power: 460 },
      { time: '10:10', power: 440 },
      { time: '10:15', power: 470 },
    ];
    const mockAlgorithms = ['Fair Share', 'Green Scheduling', 'Thermal-Aware'];
    const mockAlgorithmMetrics = {
      'Fair Share': { energyConsumption: 500, avgTemp: 65 },
      'Green Scheduling': { energyConsumption: 450, avgTemp: 60 },
      'Thermal-Aware': { energyConsumption: 470, avgTemp: 58 },
    };

    setNodes(mockNodes);
    setJobs(mockJobs);
    setEnergyMetrics(mockEnergyMetrics);
    setSchedulingAlgorithms(mockAlgorithms);
    setSelectedAlgorithm(mockAlgorithms[0]);
    setAlgorithmMetrics(mockAlgorithmMetrics);
  }, []);

  const handleAlgorithmChange = (e) => {
    setSelectedAlgorithm(e.target.value);
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>Energy-Aware Scheduler Dashboard</h1>

      <section>
        <h2>Compute Nodes Status</h2>
        <table border="1" cellPadding="8" style={{ borderCollapse: 'collapse', width: '100%' }}>
          <thead>
            <tr>
              <th>Node ID</th>
              <th>Temperature (°C)</th>
              <th>Power (W)</th>
              <th>Fan Speed (%)</th>
            </tr>
          </thead>
          <tbody>
            {nodes.map(node => (
              <tr key={node.id}>
                <td>{node.id}</td>
                <td>{node.temperature}</td>
                <td>{node.power}</td>
                <td>{node.fanSpeed}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      <section style={{ marginTop: '30px' }}>
        <h2>Jobs</h2>
        <table border="1" cellPadding="8" style={{ borderCollapse: 'collapse', width: '100%' }}>
          <thead>
            <tr>
              <th>Job ID</th>
              <th>Status</th>
              <th>Assigned Node</th>
              <th>Power (W)</th>
              <th>Duration (s)</th>
              <th>Remaining Time (s)</th>
            </tr>
          </thead>
          <tbody>
            {jobs.map(job => (
              <tr key={job.id}>
                <td>{job.id}</td>
                <td>{job.status}</td>
                <td>{job.node || 'N/A'}</td>
                <td>{job.power}</td>
                <td>{job.duration}</td>
                <td>{job.remaining}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      <section style={{ marginTop: '30px' }}>
        <h2>Energy Consumption Over Time</h2>
        <ResponsiveContainer width="100%" height={300}>
          <LineChart data={energyMetrics} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="time" />
            <YAxis label={{ value: 'Power (W)', angle: -90, position: 'insideLeft' }} />
            <Tooltip />
            <Legend />
            <Line type="monotone" dataKey="power" stroke="#8884d8" activeDot={{ r: 8 }} />
          </LineChart>
        </ResponsiveContainer>
      </section>

      <section style={{ marginTop: '30px' }}>
        <h2>Scheduling Algorithms Comparison</h2>
        <select value={selectedAlgorithm} onChange={handleAlgorithmChange}>
          {schedulingAlgorithms.map(algo => (
            <option key={algo} value={algo}>{algo}</option>
          ))}
        </select>
        {selectedAlgorithm && (
          <div style={{ marginTop: '15px' }}>
            <p><strong>Energy Consumption:</strong> {algorithmMetrics[selectedAlgorithm].energyConsumption} W</p>
            <p><strong>Average Temperature:</strong> {algorithmMetrics[selectedAlgorithm].avgTemp} °C</p>
          </div>
        )}
      </section>
    </div>
  );
}

export default App;
